        static int PositionY = 0;
        private static SerialPort serialPort = new SerialPort
        {
            PortName = "COM3",  // Use the correct port name
            BaudRate = 115200,
            Parity = Parity.None,
            DataBits = 8,
            StopBits = StopBits.One,
            Handshake = Handshake.None
        };

        //display one row of pixels
        public void DisplayRow(UInt16[] imgRow)
        {
            byte[] pixelData = new byte[imgRow.Length * 3];
            int Blue;
            int Green;
            int Red;
            for (int i = 0, j = 0; i < imgRow.Length; i++, j += 3)
            {
                Blue = (imgRow[i] >> 11) & 0x1F; // 5-bit blue
                Green = (imgRow[i] >> 5) & 0x3F; // 6-bit green
                Red = imgRow[i] & 0x1F; // 5-bit red

                Blue = (Blue << 3); // Convert 5-bit red to 8-bit
                Green = (Green << 2); // Convert 6-bit green to 8-bit
                Red = (Red << 3); // Convert 5-bit blue to 8-bit

                pixelData[j] = (byte)Blue;
                pixelData[j + 1] = (byte)Green;
                pixelData[j + 2] = (byte)Red;

            }
            Dispatcher.Invoke(() =>
            {
                bitmap.WritePixels(new Int32Rect(0, PositionY, width, 1), pixelData, width * 3, 0);
            });
            PositionY++;
            if (PositionY >= 120)
            { PositionY = 0; }
        }

        //read one row of the picture and display it
        public void ProcessIncomingData()
        {
            UInt16[] imgRow = new UInt16[width];

            byte[] pixelBuffer = new byte[width * 2];
            int bytesRead = 0;
            while (bytesRead < width * 2)
            {
                bytesRead += serialPort.Read(pixelBuffer, bytesRead, width * 2 - bytesRead);//read one row, in this case 320 bytes
            }

            for (int i = 0, PositionX = 0; i < pixelBuffer.Length; i += 2, PositionX++)
            {
                imgRow[PositionX] = BitConverter.ToUInt16(pixelBuffer, i);

            }

            DisplayRow(imgRow);

        }




        //wait for the "CAM" header which marks the begining of a package
        public void BackgroundThread()
        {
            serialPort.Open();
            string header = "";
            char temp;
            while (true)
            {
                temp = (char)serialPort.ReadByte();
                if (Char.IsLetter(temp))
                {
                    header += temp;
                }
                if (header == "CAM")
                {
                    ProcessIncomingData();

                }
                if (header.Length == 3)
                    header = header.Remove(0, 1);

            }

        }



        public MainWindow()
        {


            InitializeComponent();
            bmpImage.Source = bitmap;
            Task.Run(() => BackgroundThread());


        }
    }
